import React, { Component } from 'react';
import { Form } from 'react-bootstrap';
import { sha256 } from 'js-sha256';

class HashField extends Component {
    render() {
        return (
            <Form.Group>
                <Form.Label>
                    Data:
                </Form.Label>
                <Form.Control
                    as="textarea"
                    type="text"
                    placeholder=""
                    value={sha256(this.props.data)}
                    readonly
                    plaintext
                />
            </Form.Group>
        );
    };
}

export default HashField;
